import 'cypress-file-upload';
import {login} from '../../fixtures/login';

const restoPicture = 'data:image/png;base64,'
const testFile = 'test.png';
const testContent = 'data:image/png;base64,'

describe('ImageTest check default restaurant image', () => {
  it('First test', () => {
    login('DONOTDELETE@wqebd.de');
    cy.visit('http://localhost:8080/');
    cy.wait(5000);

    const genericSelector = '#root > div > div > div > div > div > div > div';
    cy.get(genericSelector).contains('CypressImageTests').scrollIntoView().then($element => {
      cy.wrap($element).parent().find('button#long-button').click({force: true});
      cy.get('#basic-menu').should('be.visible').then(() => {
        cy.get('#basic-menu > div.MuiPaper-root.MuiPaper-elevation.MuiPaper-rounded.MuiPaper-elevation8.MuiPopover-paper.MuiMenu-paper.MuiMenu-paper.css-3dzjca-MuiPaper-root-MuiPopover-paper-MuiMenu-paper > ul > li:nth-child(2)').click();
      });
    });
    cy.wait(3000);
    cy.get('#root > div > div > div.cCywpriAWfC5rZb8oRYj > div:nth-child(2) > div.mC99tckBB8KTxG2vYurJ > div > div > div > div > div.MuiGrid-root.MuiGrid-item.MuiGrid-grid-xs-4.MuiGrid-grid-sm-2.MuiGrid-grid-md-3.css-1pc8ge8-MuiGrid-root > img', { timeout: 10000 })
        .should('exist')
        .and(($img) => {
          expect($img.attr('src')).to.equal(restoPicture);
        });
  });
});

